import React from 'react';

function  Header(){
  return (
      <div class="header">
          <img src="resources/os_logo.png" width="400" height="100"/>
          <h3>TmaxOS Download Page</h3>
      </div>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
